import "./App.css";
import AOS from "aos";
import "aos/dist/aos.css";
import React from "react";
import { useEffect } from "react";

function App() {
	useEffect(() => {
		AOS.init({ duration: 1200 });
	}, []);

	return <div></div>;
}

export default App;
